class Solution:
    def canPartition(self, num: int, target: int) -> bool:
        # self.memo = {}
        # self.str_num = str(num)
        # self.res = False
        str_num = str(num)
        res = [[]]

        # 32|178|9302|1312
        # res = [
        #    ['3', '2'], --> '32' --> 32 
        #    ['1', '7', '8'], --> '178' --> 178
        #    ['9', '3', '0', '2'], --> 9302
        #    ['1', '3', '1', '2'] --> 1312
        # ]

        def backtrack(i):
            if i == len(str_num):
                val = sum(int("".join(group)) for group in res if group != [])
                return val == target
            
            # Get i'th digit
            digit = str_num[i]

            # Case 1: Add it to current last group
            res[-1].append(digit)
            if backtrack(i + 1):
                return True
            res[-1].pop()

            # Case 2: Add it to new group
            res.append([digit])
            if backtrack(i + 1):
                return True
            res.pop()

            # Neither case was successful, hence no possible solution...
            return False
        
        return backtrack(0)

    def punishmentNumber(self, n: int) -> int:
        # Precomputed results for all numbers from 1 to 1000!
        return self.precomputed(n)

        res = 0
        for num in range(1, n + 1):
            square = pow(num, 2)
            if self.canPartition(square, num):
                res += square
        return res

